import React from 'react';




const MealList = (props) => {
    console.log(props.passMealDetails);


    const RenderMealList = props.passMealDetails.map((each) => {

        return(


            <div key={each.id} style={{display:"flex",justifyContent:"space-between",alignItems:"center"}}>
                 <div style={{paddingLeft:"2%",paddingTop:"2%"}}><h4>{each.name}</h4>
                 </div>
                 <div>
                     <></>
                 </div>
            </div>


        );
    })

    return(
      <div style={{ borderRadius:"25px",marginTop:"3%",backgroundColor:"lightblue"}}>
           <div align='center' style={{padding:"2%"}}>
                     <h1  className='display-5'>Meal List</h1></div>
          {RenderMealList}


      </div>
  );
};

export default MealList;
